<script lang="ts">
    let CanRun = true;
    let Failed = false;
    let ErrorStr = "";
    let Username = "";
    let Password = "";
    async function Login() {
        if (!CanRun) return;
        CanRun = false;
        Failed = false;
        if (Username.length === 0 || Password.length === 0) {
            console.log("Empty Strings");
            Failed = true;
            CanRun = true;
            return;
        }
        console.log("Both exists");
        try {
            const res = await fetch("/api/accounts/login", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    Username: Username,
                    Password: Password
                })
            })

        } catch(err) {
            if (err instanceof Error) {
               ErrorStr = err.message;
               return;
            }
            throw err;  
        } finally {
            CanRun = true;
        }
    }
</script>

<svelte:head>
    <title>Login | Njord</title>
</svelte:head>

<div class="flex h-screen items-center justify-center">
    <div class="hidden md:flex lg:flex flex-col border w-full max-w-xl rounded-xl p-10 gap-5">
        
        <a class="hover:underline text-lg" href="/">‚Üê Back</a>
        <h1 class="text-bold text-2xl self-center text-[#F0F0F0]">Login to access the dashboard</h1>
        <divider class="divider divider-verticle"/>
        <label class="font-bold text-2xl text-[#F0F0F0]" for="">Username</label>
        <input class="input input-bordered" type="text" placeholder="Enter your username" bind:value={Username} />
        <label class="font-bold text-2xl text-[#F0F0F0]" for="">Password</label>
        <input class="input input-bordered" type="password" placeholder="Enter your password" bind:value={Password} />
        {#if Failed}
        <p class="text-error">Please check your username and password</p>
        {/if}
        <button class="btn btn-neutral hover:btn-accent btn-lg mt-5" type="button" on:click={Login}>Login</button>
    </div>
    <div class="flex md:hidden lg:hidden flex-col w-full max-w-xl justify-center items-center gap-y-20">
        <div class="flex flex-col items-center">
            <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="Njord_Braid" data-name="Njord Braid" width="295" height="128" viewBox="0 0 3495 2480">
                <image id="Rectangle_5" data-name="Rectangle 5" x="-173" y="316" width="3840" height="1848" xlink:href="data:img/png;base64,"/>
            </svg>
            <h1 class="font-bold text-2xl">Njord</h1>
        </div>
        <div class="flex flex-col items-center gap-y-5">
            <input class="input input-bordered" type="text" placeholder="Enter your username" bind:value={Username} />
            <input class="input input-bordered" type="password" placeholder="Enter your password" bind:value={Password} />
            <button class="btn btn-neutral hover:btn-accent btn-md px-24" type="button" on:click={Login}>Login</button>
            <div class="flex flex-row gap-x-20">
                <small><a class="hover:underline" href="/">‚Üê Back</a></small>
                <small><a class="hover:underline" href="/forget-pass">Forget password?</a></small>
            </div>
        </div>
        
    </div>
</div>